import React, { Component } from 'react';
import GapiSettings from './components/GapiSettings';
import { Grid, Cell, Title } from 'react-mdc-web/lib';


export default class Settings extends Component {

  render() {
    return (
      <Grid>
        <Cell col={12}>
          <Title>Settings</Title>
        </Cell>
        <Cell>
          <GapiSettings />
        </Cell>
      </Grid>
    );
  }
}
